import Square from './Components/010/Square';


function App() {
  return (
    <div className="App">
      <header className="App-header">
      
        <h1>Props</h1>
<Square color="black"name="Pirmadienis"></Square>
<Square color="crimson"name="Antradienis"></Square>
      </header>
    </div>
  );
}

export default App;
